import React from "react";
import "../styleSheets/Hands.css";
import styled from "../styleSheets/App.module.css";
import classNames from 'classnames';
export default function Hands(props) {

  const fingers = classNames('finger', 'finger1')
  return (
    <div class='hand' >
      <div class='fist'></div>
      <div class={fingers}></div>
      <div class='finger finger2'></div>
      <div class='finger finger3'></div>
      <div class='finger finger 4'></div>
      <div class={style.thumb}></div>
      <div class={style.arm}></div>
    </div>

  )
}
